const answers = [];

const renderQuiz = i => {
    if (!i) i = 0;
    quiz.querySelector('.title').innerHTML = quizData[i].title;
    quiz.querySelector('.task img').setAttribute('src', quizData[i].img);
    const input = quiz.querySelector('.answer input');
    input.value = '';
    input.setAttribute('data-answer', i);
    input.classList.remove('error');
    quizDop.innerHTML = '';
    if(quizData[i].dopText)
        quizData[i].dopText.forEach(el=>{
            const p = document.createElement('p');
            p.innerText = el;
            quizDop.appendChild(p);
        });
}

const startQuiz = () => {
    answers.length = 0;
    renderQuiz(0);
    quiz.classList.remove('hidden');
}

const checkAnswer = () => {
    const text = quizInput.value.trim().toLowerCase();
    const i = quizInput.getAttribute('data-answer');
    return MD5(text) === quizData[i].hash;
}

const printResult = ()=>{
    const result = quizResult.querySelector('.data');
    result.innerHTML = '';
    answers.forEach(el=>{
        const p = document.createElement('p');
        p.innerText = el;
        result.appendChild(p);
    })
    quiz.classList.add('hidden');
    quizResult.classList.remove('hidden');
}
start.querySelector('.start button').addEventListener('click', () => {
    start.classList.add('hidden');
    startQuiz();
})

quiz.querySelector('.answer button').addEventListener('click', () => {
    const result = checkAnswer();
    if (!result) {
        quizInput.classList.add('error')
        return;
    }
    let i = quizInput.getAttribute('data-answer');
    answers.push(quizData[i].hash);
    console.log(answers);
    ++i;
    if(quizData[i])
        renderQuiz(i);
    else printResult()
})